const StyledWrapper = styled.div`
  .navbar {
    background-color: #e4f4fa;
    height: 40px;
    display: flex;
    justify-content: space-between;
  }
  .menu-items {
    display: flex;
  }
  .menu-items li {
    padding: 1rem;
    color: grey;
    font-size: 1.2rem;
    padding: 0.3rem;
  }

  .menu-items :hover {
    border-bottom: 2px solid #24f4fa;
  }
`;
